import React from 'react';
import classes from './MyPosts.module.css';
import Post from './Post/Post.jsx'

const MyPosts = () => {
    return (
      <div className={classes.content}>
          <textarea name="" id="" cols="80" rows="3"></textarea>
          <div className={classes.postButtons}>
          <button>Add New</button>
          <button>Remove</button>
          </div>
          <Post name="Anton" message="HI, im new" likes="10"/>
          <Post name="Andrew" message="HELLO" likes="40"/>
          <Post name="Jack" message="I learn REact" likes="130"/>
          <Post name="John" message="Yo" likes="110"/>
          <Post name="Anton" message="I like programming" likes="999"/>
      </div>

    );
}
export default MyPosts;
